import React from 'react';
import ReactDOM from 'react-dom';
const name = "My Clock";
const date = new Date().toLocaleDateString();
const time = new Date().toLocaleTimeString();
ReactDOM.render(
    <>
    <h1> {name} </h1>
    <p>Date: {date}</p>
    <p>Time: {time}</p>
    <a href="#" target="_blank"></a>
    </>,
    document.getElementById('root')
);


